24317	18	827	Getting Started with Machine Learning Workshop by AIS - Session #3	Getting Started with Machine Learning Workshop Series for Beginners\nby The AI Society at ASU\n\nAre you curious about Machine Learning but dont know where to start? Join us for The AI Societys beginner-friendly hands-on workshop series to build a strong foundation in ML, step by step. Whether youre an undergraduate or graduate student, this series will give you the essential knowledge and skills to dive into AI.\n\nWhat to Expect:\n\n* Understand the broad landscape of Artificial Intelligence, Machine Learning, Deep Learning, and Large Language Models.\n* Learn the math for ML, including linear algebra, probability, statistics, and calculus essentials.\n* Discover supervised and unsupervised learning through regression, classification, clustering, and dimensionality reduction algorithms.\n* Participate in hands-on implementation by building ML models from scratch such as Linear Regression, Logistic Regression, KNN, Decision Trees, and more.\n* Explore advanced introductions to neural networks, computer vision basics, natural language processing, and large language models.\n* Dive into special topics like Reinforcement Learning and real-world applications of AI across industries.\n* Get introduced to essential ML tools, optimizers, and hyperparameter tuning techniques.\n\nThis series is structured for beginners. No prior ML experience required, just curiosity and willingness to learn.\n\nEvent Details\nLocation: Life Sciences Tower E-Wing, Room #106\nDates: Weekly on Wednesdays\nSep 3, Sep 10, Sep 17, Sep 24\nOct 1, Oct 8, Oct 15, Oct 22, Oct 29\nNov 5, Nov 12, Nov 19\nTime: 7:00 PM MST Onwards\nOnline Meeting Link: https://asu.zoom.us/j/84788748881\n\nStay Connected\n- Website: https://ais-asu.com\n- Instagram: https://www.instagram.com/theaisociety.asu/\n- LinkedIn: https://www.linkedin.com/company/theaisocietyasu/\n- YouTube: https://www.youtube.com/@TheAISocietyASU/\n- Discord: https