25266	18	725	Telangana Dussehra	Telangana Dussehra is a vibrant and culturally rich celebration that blends traditional Hindu Dussehra festivities with the regions unique customs, especially the Bathukamma Festival. While Dussehra across India marks the victory of good over evil  symbolized by Lord Rama defeating Ravana  in Telangana, it takes on a distinct flavor through floral worship, community gathering, and celebration of womanhood.\n\nBathukamma, meaning "Mother Goddess come alive," is the centerpiece of Dussehra celebrations in Telangana. It is a floral festival celebrated predominantly by women, who create beautiful flower stacks using seasonal flowers like gunuka, tangedi, and banthi, arranged in concentric layers. These flower arrangements are placed in the center of a circle as women sing folk songs, dance rhythmically, and worship the goddess Gauri for health, prosperity, and happiness.\n\nThe festival spans nine days, culminating on Durgashtami or Dussehra, when the Bathukammas are immersed in local water bodies, accompanied by joyful processions and music.\n---\nEvent Details: https://sundevilcentral.eoss.asu.edu/rsvp?id=383696	2025-10-04 00:30:00+00	2025-10-04 05:00:00+00	scheduled	2025-12-05 21:51:32.299691+00	2025-12-05 21:51:32.299691+00
