26023	19	1056	Movie Night - The Caste Rush	Movie Screening: The Caste Rush\nJoin Hindu YUVA at ASU for a special screening of the critically acclaimed documentary, The Caste Rush, as part of our Hindu Awareness Week events.\nAbout the Film\nThe Caste Rush is a powerful 60-minute investigative documentary directed by Nikhil Singh Rajputt that challenges widely held mainstream narratives surrounding the caste system in India. The film takes viewers on a truth-seeking journey, presenting on-the-ground realities from temples across India and highlighting lesser-known facts and traditions. It explores crucial questions:\nAre people from non-Brahmin backgrounds now serving as priests in temples?\nHow do traditions in temples across different regions of India challenge common misconceptions about caste?\nHow does Western discourse on caste impact the Hindu diaspora and shape public perception?\nBy blending expert insights with personal stories, The Caste Rush aims to provide a more balanced, fact-based, and nuanced perspective on this complex topic.\nSignificance and Why You Should Attend\nThis documentary offers a unique opportunity to engage with a topic often shrouded in controversy and misunderstanding. Attending this screening will:\nEnhance awareness: Gain a deeper understanding of the realities of the social fabric in modern India beyond a one-sided, colonial-era narrative.\nFoster informed dialogue: The screening will be followed by a discussion, encouraging a thoughtful and respectful conversation based on facts presented in the film.\nChallenge assumptions: Discover how reformist and reconciliatory efforts within Hindu society work toward uplifting and empowering marginalized communities.\n---\nEvent Details: https://sundevilcentral.eoss.asu.edu/rsvp?id=387445	2025-10-21 02:00:00+00	2025-10-21 04:00:00+00	scheduled	2025-12-05 21:51:32.299691+00	2025-12-05 21:51:32.299691+00
