27649	18	710	Rethinking Exam Preparation in the Age of AI	Exams are often seen as the ultimate measure of learning. Yet for many students, the path to exam readiness is inefficient, stressful, and disconnected from meaningful understanding. In the age of AI, this dynamic is rapidly changing. In this talk, I share experiments with an AI-powered study assistant designed to transform exam preparation from rote review into an interactive, feedback-rich learning process. Instead of passively reworking old problems, students engage in guided practice that adapts to their progress and offers immediate insights. The approach reframes exam prep as an opportunity for growth rather than judgment, while promoting genuine understanding. Ill discuss both the motivations behind this shift and early experiences from real classroom trials.\n---\nEvent Details: https://sundevilcentral.eoss.asu.edu/rsvp?id=390172	2025-11-17 23:30:00+00	2025-11-18 01:30:00+00	scheduled	2025-12-05 21:51:32.299691+00	2025-12-05 21:51:32.299691+00
