27810	17	692	Chat with the Experts- Zoom talk on The Science of Compassion	The Science of  Compassion\nWednesday November 19 \n3:00- 4:15PM (Arizona time)\nZoom event\nJenny Bilskie-Smith, LMSW, CIEC\n-------\nWhat is Actual Compassion? Prepare to See It in a Whole New Way\n\nDescription:\nIn this module, participants will learn to unlock the true essence of compassion within themselves, not only as a feeling but as a powerful tool for personal growth and healing. We will explore what compassion truly is, how it operates in our daily lives, and the profound benefits it can have on our mental and physical well-being.\n\n \n\nWhat is Compassion?\nCompassion is a basic human capacity, an innate instinct to recognize suffering in us and others, and a drive to alleviate it. However, it often competes with other instincts, such as avoiding suffering or seeking revenge. Understanding this dynamic is key to harnessing compassion in moments where it feels difficult to access. Participants will gain insight into the biology of compassion, including how stress responses can block our ability to feel compassion, and how oxytocin, the hormone of connection, plays a pivotal role in deepening relationships and enhancing resilience.\n\n\n\nWhat You'll Gain:\nPractical tools to access compassion even in challenging situations.\n\nA deeper understanding of how compassion benefits both the giver and the receiver.\n\nTechniques to cultivate resilience and prevent compassion fatigue.\n\n\n\n\nMeeting Link: https://asu.zoom.us/j/81485994237  https://asu.zoom.us/j/81485994237 Password: CAPSO\n---\nEvent Details: https://sundevilcentral.eoss.asu.edu/rsvp?id=389952	2025-11-19 22:00:00+00	2025-11-19 23:15:00+00	scheduled	2025-12-05 21:51:32.299691+00	2025-12-05 21:51:32.299691+00
