28174	19	1134	From Bits to Qubits: An Introduction to Quantum Computing	Join ACM at ASU for a special session with Dr. Mark Jackson, a theoretical physicist and the Senior Quantum Evangelist at Quantinuum. In his talk, "From Bits to Qubits: An Introduction to Quantum Computing," he will provide a foundational session for members to understand the core concepts of this revolutionary field.\n\nSpeaker: Dr. Mark Jackson (Senior Quantum Evangelist @ Quantinuum)\n\nAttend in person: \nOn Campus Location: BYENG 209 (ASU Tempe) \nDate: Monday, November 24th \nTime: 6:30 PM  8:00 PM MST \nFor more info and RSVP: https://asu.acm.org/rsvp\n\nVirtual Location via Zoom: https://asu.acm.org/attend\n\nQuantum computing is poised to revolutionize medicine, cybersecurity, and material science. But what is it, and how does it actually work? This talk will serve as the perfect foundational session to answer those questions. Dr. Jackson will demystify the core concepts of quantum computing, explaining the transition from classical bits to the power of qubits.\n\nLearn about the current status of the field, the key applications to expect (from drug discovery to new battery development), and what the future holds for this cutting-edge technology. This session is designed for students of all backgrounds, providing the essential knowledge needed to understand the next great leap in computation.\n\nWhether you're a curious beginner or preparing for a future in tech, bring your questions and get ready for an insightful discussion on the next computing revolution.\n\nTo stay updated, connect on\nOur website: https://asu.acm.org/\nSun Devil Central: https://asu.acm.org/sd\nDiscord: https://asu.acm.org/dc\nLinkedIn: https://asu.acm.org/in\nInstagram: https://asu.acm.org/ig\nThreads: https://asu.acm.org/re\nFacebook: https://asu.acm.org/fb\nPixelfed: https://asu.acm.org/pf\nBluesky: https://asu.acm.org/bs\nMastodon: https://asu.acm.org/md\nX: https://asu.acm.org/xs\n\nMeeting Link: https://asu.acm.org/attend\n---\nEvent Details: https://sundevilcentral.eoss.asu.edu/rsvp?id=390658	2025-11-25 01:30:00+00	2025-11-25 03:00:00+00	scheduled	2025-12-05 21:51:32.299691+00	2025-12-05 21:51:32.299691+00
