28756	17	701	Labriola Book Club: Looking for Smoke	Our library aide Lainey Tsosie will be hosting a virtual book club on "Looking for Smoke" to end the semester. This book is in our open stacks. Grab a copy or head to your local public library to read! Registration link can be found in our LinkTree, located in our IG bio or here at:\n\n\n"Since moving to the Blackfeet Reservation with her parents, Mara Racette has felt like an outsider, taunted by her tight-knit classmates for growing up far away. So when a local girl includes Mara in a traditional Blackfeet giveaway to honor her missing sister, Mara thinks she'll finally make some friends. Instead, a girl from the giveaway, Samantha White Tail, is found murdered. Because the members of the giveaway group were the last to see Samantha alive, each becomes a person of interest in the investigation: New girl Mara, who hated Samantha for being particularly cruel. Grief-stricken Loren Arnoux, who was Samantha's best friend until Loren's sister's disappearance drove a wedge between them. Class clown Brody Clark, whose unreciprocated crush on Samantha is an open secret. And tough guy Eli First Kill, who has his own complicated history with Samantha. Despite deep mistrust, the four must now take matters into their own hands and clear their names. Even though one of them may be the murderer. In her powerful debut novel, author K. A. Cobell (Blackfeet) weaves loss, betrayal, and complex characters into a mystery that will illuminate, surprise, and engage readers until the final word."\n---\nEvent Details: https://sundevilcentral.eoss.asu.edu/rsvp?id=391011	2025-12-28 17:00:00+00	2025-12-28 19:00:00+00	scheduled	2025-12-05 21:51:32.299691+00	2025-12-05 21:51:32.299691+00
